import './HomePage.css';
import items from './items.json';

function HomePage() {
  return (
    <div className="HomePage">
      {items.map( response => {
        return(
            <div className="box" key={response.name}>
                <img src={response.picture} alt={response.name}/>
            </div>
        )
      })}
    </div>
  );
}

export default HomePage;




